import Zoom from 'react-reveal/Zoom';
import './Leafs.css'
import React from 'react';

const Leafs_and_clouds = () => {
    return ( 
        <>
        <div className=''>
            <img className='rotate-[200deg]' src="./leafnobg.png" alt="" />
            <img className='ml-[1100px] rotate-[290deg]' src="./leafnobg.png" alt="" />
        </div>
        </>
     );
}
 
export default Leafs_and_clouds;
